import React from 'react'
import Character from '../components/Character'

export default function CharacterHolder(props){
  let orderedChars = props.props.sort((a,b) => {return a.initiative > b.initiative || a.dex > b.dex }).map((char) => <Character props={char}/>)
  return(
    <table><tbody>
      {orderedChars}
    </tbody></table>
  )
}
